import React, { Component }  from 'react';

class SearchBar extends Component
{
  render()
  {
    return (
      <div style={{
        position: 'absolute', left: '50%', top: '50%',
        transform: 'translate(-50%, -50%)'
      }}>
        <input type="text" value="Search..." style={{
          width: '100%',
          height: '5vh'
        }} />
      </div>
    );
  }
}

export default SearchBar;
